import React from 'react'

const ProjectPageItemsComponentWeb = () => {
  return (
    <div className='container'>
      <div className='row'>
      <div class="col-sm-6 mb-3 mb-sm-0"><img  src="/images/MobileDark.jpg" /></div>
      <div class="col-sm-6 mb-3 mb-sm-0"><img className='img-fluid' src="/img-fluidimages/MobileDark.jpg" /></div>
       
      </div>
    </div>
  )
}

export default ProjectPageItemsComponentWeb
